    let styles :React.CSSProperties = {position:"absolute",top:0,left:0}
    return(
        <button style={styles} onClick={()=>{
            console.log(allStore)
            console.log("token:"+sessionStorage.getItem("token"))
        }}
        >
            store
        </button>
    )
}
